import React, { Component } from 'react'

export class Bezitting extends Component {


    getStyle = () => {
        if (this.props.items.bezitting){
            return{
                background: 'blue',
                textDecoration: 'none'
            }
        }else{
            return{
                background: 'red',
                textDecoration: 'line-through'
            }
        }
    }
   
    render() {
        return this.props.items.map((item) => (
            <div>
                <p>{item.id}</p>
                <p>{item.bezitting}</p>
                <p>{item.waarde}</p>
            </div>
        ));
    }
}


export default Bezitting
